import { useSelector } from "react-redux"


export const SearchFilter = (searchdata) => {
    // const searchdata = useSelector((state) => state.array2)
    return (dispatch) => {
        const ValueStore = []
        for (let i in searchdata) {
            for (let n in i) {
                for (let b in n.name) {
                    // if (searchdata[i]) {
                    ValueStore.push(searchdata[i][n][b])
                    console.log(ValueStore)
                }
            }
        }
        dispatch({
            type: 'searchfilter',
            payload: ValueStore
        })
    }
}
